import React from 'react';
import ReactDOM from 'react-dom';
import './css/main.css'

function Nav () {
    return (
        <header class="navbar">
            <a href="#">placeholder a</a>
            <a id="nav-icon" href="#">Decoco</a>
            <a href="#">placeholder c</a>
        </header>
    );
}

 function App () {
    return (
        <Nav />
    );
}

ReactDOM.render (
    <App />,
    document.getElementById('root')
)
